import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './NavBar';  // Import the updated NavBar
import GlobalMap from './GlobalMap';  // Import GlobalMap component
import HomePage from './HomePage';    // If you have a homepage component
import HistoricalFigures from './HistoricalFigures'; // Any other components
import WorldWar1 from './WorldWar1';
import WorldWar2 from './WorldWar2';
import DinosaurEra from './DinosaurEra';

const App = () => {
    return (
        <Router>
            <div className="App">
                <NavBar />
                <Routes>
                    <Route path="/" element={<HomePage />} /> {/* Default homepage */}
                    <Route path="/map" element={<GlobalMap />} />  {/* Render GlobalMap */}
                    <Route path="/historical-figures" element={<HistoricalFigures />} />
                    <Route path="/world-war-1" element={<WorldWar1 />} />
                    <Route path="/world-war-2" element={<WorldWar2 />} />
                    <Route path="/dinosaur-era" element={<DinosaurEra />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
